const Items = (props) => {
    return ( 
        <div className="item_list col-md-12 text-white">
            <Container>
            <Row>
            <Col md={6}>
            <Container>
                <a href={props.link}><Card.Img variant="top" src={props.img} /></a>
            </Container>
            </Col>

            <Col md={6}>
            <Container>
                <div style={{margin:"50pt"}}>
                <h1>{props.name}</h1>
                <p>{props.content}</p>
                </div>
